      fetch(`${window.puntoMontaje}${rutajson}?${new URLSearchParams(param)}`).then((response) => response.json()).then((data) => {
        this.remplazaOpcionesSelect(idsel, data, true, cid, cnombre);
        if (callback)
          callback();
      }).catch((error2) => {
        alert(`Problema ${descerr}. ${JSON.stringify(param)} ${error2.message}`);
      });
